import React from 'react';

import 'drawerToggleButton.css';

const drawerToggleButton = () => {
    return (
        <button className='toggle-button'>
            <div className='toggle-button__line'></div>
            <div className='toggle-button__line'></div>
            <div className='toggle-button__line'></div>
        </button>
    );
}

export default drawerToggleButton;
